window.clipboardCopy={copyText:function(n){navigator.clipboard.writeText(n.textContent).then(function(){alert("Copied to clipboard!")}).catch(function(n){alert(n)})},init:function(n){var t=document.getElementById(n);if(!t)throw new Error("No element with ID "+n);$(t).tooltip()},copy:function(n,t){var r=document.getElementById(n),i;if(!r)throw new Error("No element with ID "+n);i=$(r);navigator.clipboard.writeText(t).then(function(){i.attr("title","Copied!").tooltip("_fixTitle").tooltip("show");setTimeout(function(){i.attr("title","Copy to clipboard").tooltip("_fixTitle").tooltip("show")},1e3)}).catch(function(n){alert(n)})}};